, or district of the address being shipped to.'=>'ISO-kod, eller namn, på delstat, provins eller distrikt i leveransadressen.','City of the address being shipped to.'=>'Ort för leveransadressen.','Second line of the address being shipped to.'=>'Andra rad för leveransadressen.','First line of the address being shipped to.'=>'Första rad för leveransadressen.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Begränsa resultatuppsättningen till produkter baserat på ett maxpris, anges med den minsta valutaenheten.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Begränsa resultatuppsättningen till produkter baserat på ett minsta pris, anges med den minsta valutaenheten.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Max antal artiklar som ska returneras i resultatuppsättningen. Standard är ingen gräns om det lämnas tomt.','Invalid category ID.'=>'Ogiltigt kategori-ID.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'WooCommerce %1$s tabellskapandet misslyckades. Har %2$s-användaren SKAPA-privilegier på %3$s-databasen?','Verifying database... One or more tables are still missing: '=>'Kontrollerar databas … En eller flera tabeller saknas fortfarande: ','Database verified successfully.'=>'Databasen verifierades.','You need WooCommerce 4.2 or newer to run this tool.'=>'Du behöver WooCommerce 4.2 eller senare för att köra det här verktyget.','The active version of WooCommerce does not support template cache clearing.'=>'Den aktiva versionen av WooCommerce stöder inte rensning av mallcachen.','Template cache cleared.'=>'Cachen för mallar har rensats.','Verify if all base database tables are present.'=>'Verifiera att alla basdatabastabeller finns.','Verify database'=>'Kontrollera databas','Verify base database tables'=>'Verifiera basdatabastabeller','This tool will empty the template cache.'=>'Detta verktyg tömmer cache-minnet för mallar.','Clear template cache'=>'Rensa cache för mall','Collect and validate EU VAT numbers at checkout'=>'Inhämta och verifiera VAT-nummer (momsregistreringsnummer) för EU i kassan','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Om din butik är baserad inom EU så rekommenderar vi att du använder utökningen EU VAT-nummer utöver automatiserad moms. Den ger din kassa ett fält där du kan samla in och verifiera en kunds EU VAT-nummer om de har något.','Get real-time order alerts anywhere'=>'Få beställningsaviseringar i realtid var som helst','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Få aviseringar om butiksaktivitet, inklusive nya beställningar och produktrecensioner direkt i dina mobila enheter med Woo-appen.','First order received'=>'Första beställning mottagen','Remove legacy coupon menu'=>'Ta bort äldre rabattkodsmeny','Coupons can now be managed from Marketing > Coupons. Click the button below to remove the legacy WooCommerce > Coupons menu item.'=>'Rabattkoder kan nu hanteras från Marknadsföring > Rabattkoder. Klicka på knappen nedan för att ta bort det äldre menyobjektet WooCommerce > Rabattkoder.','Coupon management has moved!'=>'Hantering av rabattkoder har flyttat!','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Den här videosjälvstudien kommer att hjälpa dig med processen att lägga till din första produkt i WooCommerce.','Do you need help with adding your first product?'=>'Behöver du hjälp med att lägga till din första produkt?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Att starta en modewebbplats är spännande men det kan även kännas överväldigande ibland. I den här artikeln tar vi dig igenom konfigurationsprocessen, lär dig hur du skapar lyckade produktlistningar och visar dig hur du marknadsför mot din perfekta målgrupp.','Start your online clothing store'=>'Starta din klädbutik online','The admin note layout has a wrong prop value.'=>'Layouten för adminanteckningen har ett felaktigt prop-värde.','Watch tutorial'=>'Titta på handledning','Share feedback'=>'Dela feedback','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Nu när du valt oss som partner är vårt mål att se till att vi ger dig rätt verktyg för att uppfylla dina behov. Vi ser fram emot att få din feedback om butikskonfigurationsupplevelsen så att vi kan förbättra den.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Att byta e-handelsplattformar kan verka som en stor utmaning, men det är enklare än du kanske tror att flytta dina produkter, kunder och beställningar till WooCommerce. Denna artikel hjälper dig att gå igenom denna process.','Do you want to migrate from Shopify to WooCommerce?'=>'Vill du flytta från Shopify till WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'Med WooCommerce-prenumerationer kan du introducera en rad olika prenumerationer för fysiska eller virtuella produkter och tjänster. Skapa månadens produkt-klubbar, veckovisa tjänstprenumerationer eller till och med årliga faktureringspaket. Lägg till registreringsavgifter, erbjud kostnadsfria utvärderingar eller konfigurera förfalloperioder.','Do you need more info about WooCommerce Subscriptions?'=>'Behöver du mer information om prenumerationer för WooCommerce?','There was a problem activating some of the requested plugins.'=>'Det gick inte att aktivera några av de begärda tilläggen.','Plugins were successfully activated.'=>'Tillägg aktiverades utan problem.','The requested plugin `%s`. is not yet installed.'=>'Det begärda tillägget `%s` är inte installerat än.','There was a problem installing some of the requested plugins.'=>'Det gick inte att installera några av de begärda tilläggen.','Plugins were successfully installed.'=>'Tilläggen har installerats.','The requested plugin `%s` could not be installed. Upgrader install failed.'=>'Det begärda tillägget `%s` kunde inte installeras. Installationen via uppgraderingsverktyget misslyckades.','Plugins must be a non-empty array.'=>'Tillägg måste vara en icke-tom array.','Registers whether the note is deleted or not'=>'Registrerar om anteckningen är borttagen eller inte','The image of the note, if any.'=>'Anteckningens bild, om sådan finns.','The layout of the note (e.g. banner, thumbnail, plain).'=>'Anteckningslayouten (t.ex. banderoll, miniatyrbild, oformaterad).','Sorry, there is no note with that ID.'=>'Det finns ingen anteckning med det ID.','Views'=>'Visningar','Visitors'=>'Besökare','Not enough units of %s are available in stock to fulfil this order.'=>'Det finns inte tillräckligt med enheter av %s i lager för att fullfölja den här beställningen.','&quot;%s&quot; is out of stock and cannot be purchased.'=>'”%s” är slut i lager och kan inte köpas.','West Pokot'=>'West Pokot','Wajir'=>'Wajir','Vihiga'=>'Vihiga','Uasin Gishu'=>'Uasin Gishu','Turkana'=>'Turkana','Trans Nzoia'=>'Tra