ess. Om du använder PayPal för fraktetiketter kanske du föredrar att skicka till leveransadressen istället för faktureringsadressen. Om du stänger av det här alternativet finns det risk att säljarskyddet från PayPal slutar gälla.','Log PayPal events, such as IPN requests, inside %s Note: this may log personal information. We recommend using this for debugging purposes only and deleting the logs when finished.'=>'Logga PayPal-händelser, såsom IPN-förfrågningar, inuti %s. Obs: Detta kan logga personlig information. Vi rekommenderar att du endast använder detta för felsökning och tar bort loggarna när du är klar.','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard omdirigerar kunder till PayPal där de kan ange sin betalningsinformation.','Other locations'=>'Andra platser','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Any &quot;%1$s&quot; method'=>'Vilken ”%1$s”-metod som helst','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Ta emot betalningar personligen med checkar. Denna offline-betalmodul kan även vara användbar för testköp.','Account details:'=>'Kontodetaljer:','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Ta emot betalningar personligen via BACS. Mer känt som banköverföring.','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'att,av,bara,blev,bli,blir,blivit,bort,borta,de,del,delen,dem,den,denna,deras,dess,dessa,det,detta,dig,din,dina,dit,ditt,dock,du,där,därför,då,efter,en,er,era,ert,ett,fick,fin,finnas,finns,få,får,fått,för,före,gör,göra,ha,hade,haft,har,hur,här,hög,i,in,ja,jag,ju,man,med,men,mer,mera,mig,min,mina,nej,ni,nog,nu,när,också,om,oss,på,sin,sina,själv,ska,säga,säger,så,tack,till,tills,upp,ur,ut,utan,vad,var,vara,varför,vem,verkligen,vi,vid,vilken,vilket,vill,vår,våra,vårt,än,ännu,är,även,åt,www','Optionally add some text for the terms checkbox that customers must accept.'=>'Valfritt: lägg till text för villkorskryssrutan som kunderna måste godkänna.','%s page'=>'Sidan %s','No page set'=>'Ingen sida vald','Highlight required fields with an asterisk'=>'Markera obligatoriska fält med en asterisk','I have read and agree to the website %s'=>'Jag har läst och godkänner webbplatsens %s','Required'=>'Obligatoriskt','%s field'=>'Fältet %s','These options let you change the appearance of the WooCommerce checkout.'=>'Dessa alternativ låter dig ändra utseendet i WooCommerce-kassan.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Se <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPals integritetspolicy</a> för mer detaljer.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Vi tar emot betalningar genom PayPal. När vi behandlar betalningar, kommer några av dina uppgifter att skickas till PayPal, inklusive information som krävs för att behandla eller ge support för betalningen, såsom köpets totalsumma och faktureringsinformation.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'I den här undersektionen bör du lista vilka tredjeparts-betalväxlar du använder för att ta emot betalningar i din butik, eftersom dessa antagligen hanterar kunduppgifter. Vi har tagit med PayPal som ett exempel, men du bör ta bort detta om du inte använder PayPal.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Vi delar information med tredje part som hjälper oss genomföra beställningar och lagra tjänster åt dig, till exempel --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'I den här sektionen bör du lista vem du delar uppgifter med och för vilket syfte. Detta kan innefatta, men inte vara begränsat till, analys, marknadsföring, betalningslösningar, fraktbolag och tredjeparts-inbäddningar.','What we share with others'=>'Vad vi delar med andra','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Vårt team har tillgång till denna information för att uppfylla beställningar, genomföra återbetalningar och tillhandahålla support.','Customer information like your name, email address, and billing and shipping information.'=>'Kundinformation såsom ditt namn, e-postadress samt fakturerings- och leveransinformation.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Beställningsinformation som t.ex. vad som köptes, när det köptes och var det ska skickas, samt','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Medlemmar i vårt team har tillgång till informationen du ger oss. Till exempel, både administratörer och butiksägare har tillgång till:','Who on our team has access'=>'Vem i vårt team har åtkomst','We will also store comments or reviews, if you choose to leave them.'=>'Vi lagrar även kommentarer eller recensioner, om du lämnar dessa.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Generellt lagrar vi bara information om dig så länge vi behöver informationen för de ändamål vilka vi samlar in och använder den, och så länge vi inte är juridiskt skyldiga att lagra den. Till exempel kommer vi att lagra beställningsinformation för gällande tidsperiod för skatte- och redovisningsändamål. Detta inkluderar ditt namn, e-postadress och fakturerings- och leveransadresser.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Om du skapar ett konto kommer vi att lagra ditt namn, adress, e-postadress och telefonnummer, vilket kommer användas för att fylla i dina uppgifter i kassan för framtida beställningar.','Send you marketing messages, if you choose to receive them'=>'Skicka dig marknadsföringsmeddelanden, om du väljer att ta emot dem','Improve our store offerings'=>'Förbättra vår butikserbjudanden','Comply with any legal obligations we have, such as calculating taxes'=>'Följa lagliga krav vi har, såsom momsberäkning','Set up your account for our store'=>'Konfigurera ditt konto för vår butik','Process payments and prevent fraud'=>'Behandla betalningar och förhindra bedrägerier','Respond to your requests, including refunds and complaints'=>'Svara på dina frågor, inklusive återköp och klagomål','Send you information about your account and order'=>'Skicka information till dig om ditt konto och din beställning','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'När du köper från oss, ber vi dig att ge oss information som innefattar ditt namn, faktureringsadress, leveransadress, e-postadress, telefonnummer, kreditkortsuppgifter/betalningsuppgifter och valfri kontoinformation såsom användarnamn och lösenord. Vi använder denna information för syften, såsom att:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Obs: du kan behöva beskriva din cookie-policy mer utförligt, och länka till det avsnittet här.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Vi använder också cookies för att hålla reda på varukorgens innehåll medan du använder vår webbplats.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Leveransadress: vi ber dig ange detta så att vi, till exempel, kan beräkna frakt innan du beställer, och skicka dig beställningen!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Platsinformation, IP-adress och webbläsartyp: vi använder detta för ändamål såsom momsberäkning och fraktkostnader','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Produkter som du har visat: vi använder detta för att exempelvis visa dig produkter som du nyligen har tittat på.','While you visit our site, we’ll track:'=>'Medan du besöker vår webbplats, kommer vi att spåra:','What we collect and store'=>'Vad vi samlar in och lagrar','We collect information about you during the checkout process on our store.'=>'Vi samlar in information om dig under kassaprocessen i vår butik.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Detta provspråk omfattar grunderna kring vilka personuppgifter som din butik samlar in, lagrar och delar, samt vilka som kan få tillgång till dessa uppgifter. Beroende på vilka inställningar som är aktiverade och vilka andra tillägg som används, varierar den specifika information som delas av din butik. Vi rekommenderar att rådfråga en advokat när du bestämmer vilken information som ska omfattas och beskrivas i din integritetspolicy.','Token'=>'Token','Payment Tokens'=>'Betalnings-tokens','Access granted'=>'Åtkomst beviljad','Download count'=>'Nedladdningsräknare','User email'=>'Användarens e-post','Browser User Agent'=>'Webbläsaranvändaragent','Items Purchased'=>'Köpta produkter','Order Number'=>'Beställningsnummer','Download ID'=>'Nedladdnings-ID','Access to Purchased Downloads'=>'Åtkomst till köpta nedladdningar','Purchased Downloads'=>'Köpta nedladdningar','Customer Data'=>'Kunduppgifter','Removed payment token "%d"'=>'Tog bort betalningstoken ”%d”','Personal data removed.'=>'Personuppgifter har tagits bort.','Customer download permissions have been retained.'=>'Kundens nedladdningsbehörigheter har bevarats.','Removed access to downloadable files.'=>'Tog bort åtkomst till nedladdningsbara filer.','Personal data within order %s has been retained.'=>'Personuppgifter inom beställningen %s har bevarats.','Removed personal data from order %s.'=>'Personliga uppgifter borttagna från beställning #%s.','Removed customer "%s"'=>'Tog bort kund ”%s”','Shipping State'=>'Delstat för leverans','Shipping Postal/Zip Code'=>'Postnummer för leverans','Shipping City'=>'Ort för leverans','Shipping Company'=>'Företag för leverans','Shipping Last Name'=>'Efternamn för leverans','Shipping First Name'=>'Förnamn för leverans','Phone Number'=>'Telefonnummer','Billing State'=>'Delstat för fakturering','Billing Postal/Zip Code'=>'Postnummer för fakturering','Billing City'=>'Ort för fakturering','Billing Company'=>'Företag för fakturering','Billing Last Name'=>'Efternamn för fakturering','Billing First Name'=>'Förnamn för fakturering','Error during status transition.'=>'Ett fel intr