ttribute slug.'=>'Begränsa resultatet till produkter med ett specifikt attribut. Använd taxonomins namn eller egenskapens permalänk (slug).','Parent product does not match current variation.'=>'Överordnad produkt matchar inte nuvarande variant.','If the payment was refunded via the API.'=>'Om betalningen återbetalades via API:et.','Order total formatted for locale'=>'Beställningens totalsumma, formaterad för språk','Name of the customer for the order'=>'Kundens namn i beställningen','URL to edit the order'=>'URL för att redigera beställningen','Blog id of the record on the multisite.'=>'Blogg-ID för posten på multisite.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Det verkar inte som att din butik använder en säker anslutning. Vi rekommenderar starkt att hela din webbplats använder HTTPS för att hålla kunduppgifter säkra. <a href="%s">Lär dig mer här.</a>','WooCommerce pages'=>'WooCommerce-sidor','WooCommerce database version'=>'WooCommerce databasversion','Displays whether or not WordPress is using an external object cache.'=>'Visar om WordPress använder en extern objektcache eller inte.','External object cache'=>'Extern objektcache','WordPress cron'=>'WordPress cron','WordPress debug mode'=>'WordPress felsökningsläge','WordPress memory limit'=>'WordPress minnesgräns','WordPress multisite'=>'WordPress multisite','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s – Det finns en nyare version av WordPress tillgänglig (%2$s)','WordPress version'=>'WordPress-version','WooCommerce version'=>'WooCommerce-version','Settings tab labelPayments'=>'Betalningar','Enable coupons'=>'Aktivera rabattkoder','Rates will be configurable and taxes will be calculated during checkout.'=>'Man kommer att kunna konfigurera momssatser och moms kommer att beräknas i kassan.','Enable tax rates and calculations'=>'Aktivera momssatser och beräkningar','Manage'=>'Hantera','Enable the legacy REST API'=>'Använd det ursprungliga REST API:et','Account endpoints'=>'Kontoändpunkter','Secure checkout'=>'Säker kassa','Legacy API'=>'Ursprungligt API','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Bevara färdigbehandlade beställningar under en viss tid innan personuppgifterna i dem anonymiseras.','Retain completed orders'=>'Bevara färdigbehandlade beställningar','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Avbrutna beställningar är obetalda och kan ha blivit avbrutna av butiksägaren eller kunden. De kommer att slängas efter angiven varaktighet.','Retain cancelled orders'=>'Bevara avbrutna beställningar','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Misslyckade beställningar är obetalda och kan ha övergivits av kunden. De kommer att slängas efter den angivna tidsperioden.','Retain failed orders'=>'Bevara misslyckade beställningar','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Väntande beställningar är obetalda och kan ha övergivits av kunden. De kommer att slängas efter den angivna tidsperioden.','Retain pending orders '=>'Bevara väntande beställningar ','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Inaktiva konton är de som inte har loggat in, eller beställt något, för den angivna tidsperioden. De kommer att raderas. Eventuella beställningar kommer att konverteras till gästbeställningar.','Retain inactive accounts '=>'Bevara inaktiva konton ','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Välj hur länge du behåller personuppgifter när de inte längre behövs för bearbetning. Lämna följande alternativ tomma för att behålla dessa uppgifter på obestämd tid.','Personal data retention'=>'Personuppgiftsbevaring','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Dina personuppgifter kommer användas för att behandla din beställning, förbättra din upplevelse på webbplatsen och för andra ändamål som beskrivs i vår %s.','Optionally add some text about your store privacy policy to show during checkout.'=>'Valfritt: lägg till text din butiks integritetspolicy för att visa i kassan.','Checkout privacy policy'=>'Integritetspolicy i kassan','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Dina personuppgifter kommer användas för att förbättra din upplevelse på webbplatsen, hantera åtkomst till ditt konto och för andra ändamål som beskrivs i vår %s.','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Valfritt: lägg till text om din butiks integritetspolicy för att visa i kontoregistreringsformulär.','Registration privacy policy'=>'Integritetspolicy för registrering','privacy page'=>'integritetssida','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Denna sektion styr visningen av din webbplats integritetspolicy. Integritetsnotiserna nedan kommer inte att visas förrän en %s är inställd.','Privacy policy'=>'Integritetspolicy','Removed personal data from %s order.'=>'Personuppgifter borttagna från %s beställning.' . "\0" . 'Personuppgifter borttagna från %s beställningar.','Account erasure requests'=>'Begäran om borttagning av konto','Allow customers to create an account on the "My account" page'=>'Låt kunder skapa ett konto på sidan ”Mitt konto”','Allow customers to create an account during checkout'=>'Låt kunder skapa ett konto i kassan','Allow customers to log into an existing account during checkout'=>'Låt kunder logga in på ett befintligt konto i kassan','Allow customers to place orders without an account'=>'Låt kunder genomföra beställningar utan ett konto','Guest checkout'=>'Gästköp','Accounts &amp; Privacy'=>'Konton och integritet','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Lista över tillåtna fakturerings-e-postadresser att kontrollera mot när en beställning görs. Separera e-postadresser med kommatecken. Du kan också använda en asterisk (*) för att matcha delar av en e-postadress. Exempelvis skulle "*gmail.com" matcha alla gmail-adresser.','Allowed emails'=>'Tillåtna e-postadresser','Filter by registered customer'=>'Filtrera efter registrerad kund','Remove personal data'=>'Ta bort personuppgifter','Use previous column mapping preferences?'=>'Använd tidigare alternativ för kolumnmappning?','View &amp; Customize'=>'Visa och anpassa','Review Settings'=>'Granska inställningar','Visit Dashboard'=>'Besök adminpanel','You can also:'=>'Du kan också:','You\'re ready to add products to your store.'=>'Du är redo att lägga till produkter i din butik.','Create some products'=>'Skapa några produkter','Continue with WooCommerce Services'=>'Fortsätt med WooCommerce Services','Connect your store to activate WooCommerce Services'=>'Anslut din butik för att aktivera WooCommerce Services','Thanks for using Jetpack! Your store is almost ready: to activate services like %s, just connect your store.'=>'Tack för att du använder Jetpack! Din butik är nästan klar: för att aktivera tjänster som %s, anslut bara din butik.','Mailchimp for WooCommerce'=>'Mailchimp för WooCommerce','Mailchimp icon'=>'Mailchimp-ikon','Join the 16 million customers who use Mailchimp. Sync list and store data to send automated emails, and targeted campaigns.'=>'Gå med de 16 miljoner kunder som använder Mailchimp. Synkronisera listor och lagra data för att skicka automatiska e-postmeddelanden och riktade kampanjer.','Mailchimp'=>'Mailchimp','automated taxes icon'=>'ikon för automatisk moms','Save time and errors with automated tax calculation and collection at checkout. Powered by WooCommerce Services and Jetpack.'=>'Spara tid och fel med automatisk momsberäkning och debitering i kassan. Drivs av WooCommerce Services och Jetpack.','Storefront icon'=>'Ikon för Storefront','Design your store with deep WooCommerce integration. If toggled on, we’ll install <a href="https://woo.com/storefront/" target="_blank" rel="noopener noreferrer">Storefront</a>, and your current theme <em>%s</em> will be deactivated.'=>'Utforma din butik med djup WooCommerce-integration. Om den är påslagen kommer vi att installera <a href="https://woo.com/storefront/" target="_blank" rel="noopener noreferrer">Storefront</a> och ditt nuvarande tema <em>%s</em> kommer att inaktiveras.','Enhance your store with these recommended free features.'=>'Förbättra din butik med dessa rekommenderade gratisfunktioner.','Recommended for All WooCommerce Stores'=>'Rekommenderade för alla WooCommerce-butiker','The PayFast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs.'=>'Utökningen PayFast for WooCommerce låter dig ta emot betalningar via kreditkort och EFT via ett av Sydafrikas mest populära betalsätt. Inga installationsavgifter eller månadskostnader.','WooCommerce PayFast Gateway'=>'WooCommerce PayFast Gateway','The eWAY extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.'=>'Utökningen eWAY for WooCommerce låter dig ta emot betalningar via kreditkort direkt i din butik, utan att omdirigera kunder till en tredjepartswebbplats för att genomföra betalningen.','WooCommerce eWAY Gateway'=>'WooCommerce eWAY Gateway','WooCommerce Square'=>'WooCommerce Square','Klarna Payments for WooCommerce'=>'Klarna Payments for WooCommerce','Klarna Checkout for WooCommerce'=>'Klarna Checkout for WooCommerce','WooCommerce Stripe Gateway'=>'WooCommerce Stripe Gateway','The following plugins will be installed and activated for you:'=>'Följande tillägg kommer att installeras och aktiveras åt dig:','Help WooCommerce improve with usage tracking'=>'Hjälp WooCommerce att förbättras med användningsspårning','%1$s (%2$s %3$s)'=>'%1$s (%2$s %3$s)','What currency do you accept payments in?'=>'Vilken valuta accepterar du betalningar i?','Choose a state&hellip;'=>'Välj en delstat …','Recommended'=>'Rekommenderad','Year(s)'=>'År','Month(s)'=>'Månad/månader','Week(s)'=>'Vecka/veckor','Day(s)'=>'Dag/dagar','You don&#8217;t have permission to do this.'=>'Du har inte behörighet att göra detta.','Insufficient privileges to import products.'=>'Otillräckliga behörigheter att importera produkter.','Insufficient privileges to export products.'=>'Otillräckliga behörigheter att exportera produkter.','Loading network orders'=>'Laddar nätverksbeställningar','WooCommerce Network Orders'=>'WooCommerce nätverksbeställningar','You do not have permission to edit API Keys'=>'Du saknar behörighet att ändra API-nycklar','REST API'=>'REST API','No keys found.'=>'Inga nycklar hittades.','Return to payments'=>'Tillbaka till betalningar','Yasothon'=>'Yasothon','Yala'=>'Yala','Uttaradit'=>'Uttaradit','Uthai Thani'=>'Uthai Thani','Udon Thani'=>'Udon Thani','Ubon Ratchathani'=>'Ubon Ratchathani','Trat'=>'Trat','Trang'=>'Trang','Tak'=>'Tak','Surin'=>'Surin','Surat Thani'=>'Surat Thani','Suphan Buri'=>'Suphan Buri','Sukhothai'=>'Sukhothai','Songkhla'=>'Songkhla','Sisaket'=>'Sisaket','Sing B