lities within these applications or the PHP core itself. If enabled on your server, Suhosin may need to be configured to increase its data submission limits.'=>'Suhosin är ett avancerat skydd för PHP installationer. Den är avsedd för att skydda dina servrar mot ett antal kända problem i PHP-applikationer, samt eventuella okända sårbarheter inuti dessa applikationer eller i PHP installationen. Om Suhosin är aktiverat på din server, kan det behöva konfigureras för att öka dess dataöverförings gränser.','SUHOSIN installed'=>'SUHOSIN installerat','The maximum number of variables your server can use for a single function to avoid overloads.'=>'Det maximala antalet variabler din server kan använda för en enskild funktion, för att motverka driftstörningar.','PHP max input vars'=>'Maxvärden för PHP inmatning','The amount of time (in seconds) that your site will spend on a single operation before timing out (to avoid server lockups)'=>'Mängden tid (i sekunder) som din webbplats kommer att spendera på en enskild händelse innan den avbryts (för att undvika låsningar av servern)','PHP time limit'=>'PHP-tidsgräns','The largest filesize that can be contained in one post.'=>'Den största filstorleken som kan inkluderas i en post.','PHP post max size'=>'Största storlek för PHP post','The version of PHP installed on your hosting server.'=>'Den version av PHP som är installerad på din server.','PHP version.'=>'PHP-version.','Information about the web server that is currently hosting your site.'=>'Information om den webbserver där din webbplats finns.','Server info.'=>'Serverinformation.','Server environment'=>'Servermiljö','The current language used by WordPress. Default = English'=>'Det språk som WordPress använder sig av just nu. Standard = Engelska','Language'=>'Språk','Displays whether or not WordPress is in Debug Mode.'=>'Visar om WordPress befinner sig i felsökningsläge eller inte.','The maximum amount of memory (RAM) that your site can use at one time.'=>'Maximalt RAM-minne som